import React from 'react'

export const Search = () => {
  return (
    <div className='w-full h-[10vh] relative flex translate-x-44 items-center'>
        <i className="ri-search-line text-2xl text-zinc-100"></i>
         <input type="text" placeholder='search jobs on the basis of title' className='w-[40%] mx-3 p-2 text-xl border-black rounded-md' />
         <i className="ri-close-line text-2xl text-zinc-100"></i>
         
    </div>
  )
}
